const LeftComponent=sty

const dialogstyle={
    height:'96%',
    width:'100%',
    margin:'20px',
    maxWidth:'100%',
    maxHeight:'100%',
    boxShadow:'none',
    overflow:'hidden',
    borderRadius:0,
}

const ChatDialog=()=>{

    return(
        <Dialog open={true} PaperProps={{sx: dialogstyle}} hideBackdrop={true}>
            <Component>
                <Box>
                    <Menu/>
                </Box>
                <Box>
                    <EmptyChat/>
                </Box>
            </Component>
        </Dialog>
    )
}
export default ChatDialog;
